import React from 'react';

import {  SectionTitle, AdressSection} from '../../../xamin';
const Cards = (props) => {
    const cardList = props.cardList;
    return cardList.map((card, index) => (
        <div key={index}  className="iq-services-box wow fadeInUp text-left">
            <div className="services-content">
            <h6>Data Science Capstone</h6>
                                    <span class="progress-value">60%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="60"></span> </div>
             </div>
        </div>

    ));
};

class   Index extends React.Component {
    constructor(props) {
        super(props);
        this.state={
           data:[
               {

                   hedaing:"Data Science Capstone",
                   value:"60%"  
               },
               {

                    hedaing:"Python",
                    value:"70%"  
                },
                {

                    hedaing:"Machine Learning",
                    value:"80%"  
                }
           ],
           data1:[
            {

                hedaing:"SQL",
                value:"80%"  
            },
            {

                 hedaing:"Tableau",
                 value:"65%"  
             },
             {

                 hedaing:"java",
                 value:"70%"  
             }
        ]
        }
    }

    render() {
        return (
            <>
              <section class="pt-0">
                <div class="container">
                    <div class="row ">
                        <div class="col-md-12">
                                 <SectionTitle
                                    className={"title-box wow fadeInUp text-center"}
                                    title={"Skills"}
                                />
                        </div>
                    </div>
                    <div class="row">
                        <div class="col-sm-12 col-lg-5 col-md-5">
                            <div class="iq-services-box wow fadeInUp text-left">
                                <div class="services-content">
                                    <h6>Data Science Capstone</h6>
                                    <span class="progress-value">60%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="60"></span> </div>
                                </div>
                                <div class="services-content">
                                    <h6>Python</h6>
                                    <span class="progress-value">70%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="70"></span> </div>
                                </div>
                                <div class="services-content">
                                    <h6>Machine Learning</h6>
                                    <span class="progress-value">80%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="80"></span> </div>
                                </div>
                            </div>
                        </div>
                        <div class="col-sm-12 col-lg-5 col-md-5 offset-md-2">
                            <div class="iq-services-box wow fadeInUp text-left">
                                <div class="services-content">
                                    <h6>SQL</h6>
                                    <span class="progress-value">80%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="80"></span> </div>
                                </div>
                                <div class="services-content">
                                    <h6>Tableau</h6>
                                    <span class="progress-value">65%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="65"></span> </div>
                                </div>
                                <div class="services-content">
                                    <h6>java</h6>
                                    <span class="progress-value">70%</span>
                                    <div class="iq-progress-bar"> <span class="position-relative" data-percent="70"></span> </div>
                                </div>
                            </div>
                        </div>


                    </div>
                </div>
            </section>
            </>
        );
    }
}

export default Index;
